import D2HelpBtn from "./components/d2-help-btn";
import D2Badge from "./components/d2-badge";
import D2PageCover from "./components/d2-page-cover";
import LineChart from "./components/LineChart";
import RingChart from "./components/RingChart";
import ShowNowTime from "./components/ShowNowTime";
import TagMessageList from "./components/TagMessageList";
import util from '@/libs/util';
import axios from 'axios';
import Qs from 'qs';
export default {
  components: {
    D2HelpBtn: D2HelpBtn,
    D2Badge: D2Badge,
    D2PageCover: D2PageCover,
    LineChart: LineChart,
    RingChart: RingChart,
    TagMessageList: TagMessageList,
    ShowNowTime: ShowNowTime
  },
  data: function data() {
    return {
      filename: __filename,
      flag: '',
      flag2: '',
      userid: util.cookies.get('user-id'),
      user: {},
      alter: false,
      formLabelWidth: '120px'
    };
  },
  methods: {
    getStudent: function getStudent(userid) {
      var _this = this;

      axios.post('http://localhost:8080/GetOneStudent', Qs.stringify({
        id: userid
      })).then(function (response) {
        console.log(response);
        _this.user = response.data;
      }).catch(function (error) {
        console.log(error);
      });
    },
    alterStudent: function alterStudent() {
      this.alter = false;
      axios.post('http://localhost:8080/AlterStuRow', Qs.stringify(this.user)).then(function (response) {
        console.log(response);
      }).catch(function (error) {
        console.log(error);
      });
    }
  },
  mounted: function mounted() {
    this.flag = util.cookies.get('user-flag'), this.getStudent(this.userid);
  }
};
